#include <iostream>
#include <cstdio>

using namespace std;

typedef unsigned long long ull;

const ull x = 214013ll;
const ull y = 2531011ll;
const ull mod = (1ll << 32);

int n, l, r;
ull z, cur, ans, lc, rc;

inline ull bp(ull a, ull b) {
	ull res = 1;
	while (b) {
		if (b & 1)
			res = res * a % mod;
		a = a * a % mod;
		b >>= 1;
	}
	return res;
}

inline ull pr(ull cur) {
	ull res = cur - y;
	while (res < 0)
		res += mod;
	res = res * z % mod;
	return res;
}

inline ull nxt(ull cur) {
	return (cur * x + y) % mod;
}

int main() {
	freopen("A.in", "r", stdin);
	freopen("A.out", "w", stdout);
	
	z = bp(x, (mod >> 1) - 1ll);

	scanf("%d %I64d", &n, &cur);

	for (int i = 1; i <= n; i++, cur = nxt(cur)) {
		l = r = i;
		lc = rc = cur;
		while (l > 1 && pr(lc) <= cur)
			lc = pr(lc), l--;
		while (r < n && nxt(rc) <= cur)
			rc = nxt(rc), r++;
		ans += (r - l + 1) * 1ll;
	}

	printf("%I64d", ans);

	return 0;
}
